<#
        .AUTHOR
        Matt Oestreich
        .SYNOPSIS
        With the help of embedded Sorlov Assemblies (https://twitter.com/sorlov/status/515149451691044864), creates a Windows Service via .ps1 script.
        THANK YOU DANIEL SORLOV!
        .DESCRIPTION
        This script is designed to convert at .ps1 looping script into a Windows Service legible binary file (aka .exe).
        It will then install the service using variables provided by the user.
        .EXAMPLE
        Run this script with Powershell.
#>
Clear-Host
if(!(Test-Path "$env:USERPROFILE\Downloads\CreateNewService")){New-Item "$env:USERPROFILE\Downloads\CreateNewService" -Type Directory | Out-Null}

# File Variables
$Script:downloadDir = "$env:USERPROFILE\Downloads\CreateNewService"
$Script:fileCORE = "$env:USERPROFILE\Downloads\CreateNewService\Sorlov.PowerShell.Core.dll"
$Script:fileSH = "$env:USERPROFILE\Downloads\CreateNewService\Sorlov.PowerShell.SelfHosted.dll"
$Script:filePSD1 = "$env:USERPROFILE\Downloads\CreateNewService\psd1.psd1"

function Get-ServiceName {   
    Write-Host "Type the desired SERVICE NAME [[ this is NOT the display name! ]] `r`nService Name must not contain spaces!" -f Yellow
    $aa = Read-Host 
    if($aa -eq '' -or $aa -match ' ')
    {
        Write-Host 'Service name cannot be blank, or contain spaces!' -f Red
        Write-Host ''
        Remove-Variable -Name aa -Force | Out-Null
        Get-ServiceName
    }
    else
    {
        return $aa
    }           
}

function Get-ServiceDisplayName {
    Write-Host 'Type the desired service DISPLAY name.' -f Yellow
    $b = Read-Host
    if($b -eq '')
    {
        Write-Host 'Service display name cannot be empty!' -f Red
        Write-Host ''
        Remove-Variable -Name b -Force | Out-Null
        Get-ServiceDisplayName
    }
    else
    {
        return $b
    } 
}

function Get-ServiceCreds {
    Write-Host ''
    Write-Host 'You will now be prompted for a service account that will be used to run this service.' -f Green
    Write-Host ''
    Pause
    $abg = $Host.UI.PromptForCredential(
        "Service Credentials",
        "Enter new credentials for the services.",
        "$env:USERDOMAIN\",
        ""
    )

    return $abg
}

function Get-ServiceDescription {
    Write-Host 'Type the desired service description' -f Yellow
    $l = Read-Host
    if($l -ne '')
    {
        return $l
    }

    if($l -eq '')
    {
        Write-Host 'Entry cannot be blank.' -f Red
        Pause
        Get-ServiceDescription
    }
} 

Function Get-FileName{
    [System.Reflection.Assembly]::LoadWithPartialName('System.windows.forms') | Out-Null    
    $ofd = New-Object System.Windows.Forms.OpenFileDialog
    $ofd.RestoreDirectory = $false
    $ofd.filter = 'PS1 (*.ps1)| *.ps1'
    $resultGFN = $ofd.ShowDialog() 

    if($resultGFN -eq 'OK')
    {  
        return $ofd.FileName
    }
    else
    {
        Write-Host 'Either user cancelled or an error was encountered! Try again.' -f Red
        Pause
        Get-FileName
    }
}

Function Get-SaveFileName {
    [System.Reflection.Assembly]::LoadWithPartialName('System.windows.forms') | Out-Null    
    $sfd = New-Object System.Windows.Forms.SaveFileDialog
    $sfd.RestoreDirectory = $false
    $sfd.filter = 'EXE (*.exe)| *.exe'
    $sfd.FileName = "$svcName"
    $sfd.Title = 'Save .EXE file to be used as service'
    $resultGSFN = $sfd.ShowDialog()

    if($resultGSFN -eq 'OK')
    {  
        return $sfd.FileName
    }
    else
    {
        Write-Host 'Either user cancelled or an error was encountered! Try again.' -f Red
        Pause
        Get-SaveFileName
    }
}

function Convert-Files {   
    Write-Host 'Converting unpacked DLL files...' -f Yellow
    $Script:bc = [System.Convert]::FromBase64String($CoreDLL)
    Write-Host 'Converted DLL file(s)' -f Green
    Start-Sleep -Milliseconds 200
    $Script:bsh = [System.Convert]::FromBase64String($SelfHostedDLL)
    Write-Host 'Converted DLL file(s)' -f Green
    Start-Sleep -Milliseconds 200
    $Script:bd1 = [System.Convert]::FromBase64String($psd1)
    Write-Host 'Converted DLL file(s)' -f Green
    Start-Sleep -Milliseconds 200
    Write-Host ''
}

function Export-Files { 
    if(!(Test-Path $fileCORE))
    {   
        Write-Host 'Exporting converted DLL files for use...' -f Yellow
        [System.IO.File]::WriteAllBytes($fileCORE, $bc) | Out-Null
        Write-Host 'Exported DLL file(s)' -f Green
        Start-Sleep -Milliseconds 200
    }
    else{Write-Host 'DLL Already Found! Continuing...' -f Red}
    if( !(Test-Path $fileSH) )
    {      
        [System.IO.File]::WriteAllBytes($fileSH, $bsh) | Out-Null
        Write-Host 'Exported DLL file(s)' -f Green
        Start-Sleep -Milliseconds 200
    }
    else{Write-Host 'DLL Already Found! Continuing...' -f Red}
    if( !(Test-Path $filePSD1) )
    {  
        [System.IO.File]::WriteAllBytes($filePSD1, $bd1) | Out-Null
        Write-Host 'Exported DLL file(s)' -f Green
        Start-Sleep -Milliseconds 200
    }
    else{Write-Host 'DLL Already Found! Continuing...' -f Red}
    Write-Host ''
}

function Import-dllFiles { 
    Write-Host 'Importing DLL files into current session..' -f Yellow
    Import-Module $fileCORE   
    Start-Sleep -Milliseconds 200
    Write-Host 'Imported Module(s)' -f Green
    Import-Module $fileSH
    Write-Host 'Imported Module(s)' -f Green
    Write-Host ' '
}

function Set-ServiceCredential {

    param(
        [String[]]$serviceName,
        [Management.Automation.PSCredential]$serviceCredential
    )

    $computerName = $env:COMPUTERNAME
    $wmiFilter = "Name='{0}' OR DisplayName='{0}'" -f $serviceName
    $params = @{
        "Namespace" = "root\CIMV2"
        "Class" = "Win32_Service"
        "ComputerName" = $computerName
        "Filter" = $wmiFilter
    }        
    $service = Get-WmiObject @params

    if ( -not $service ) {
        Write-Error "Unable to find service named '$serviceName' on '$computerName'."
        return
    }
    if ( $service ) {
        # See https://msdn.microsoft.com/en-us/library/aa384901.aspx
        $returnValue = ($service.Change($null,                       # DisplayName
                $null,                                               # PathName
                $null,                                               # ServiceType
                $null,                                               # ErrorControl
                $null,                                               # StartMode
                $null,                                               # DesktopInteract
                $serviceCredential.UserName,                         # StartName
                $serviceCredential.GetNetworkCredential().Password,  # StartPassword
                $null,                                               # LoadOrderGroup
                $null,                                               # LoadOrderGroupDependencies
        $null)).ReturnValue                                  # ServiceDependencies
        $errorMessage = "Error setting credentials for service '$serviceName' on '$computerName'"
        switch ( $returnValue ) {
            0  { Write-Verbose "Set credentials for service '$serviceName' on '$computerName'" }
            1  { Write-Error "$errorMessage - Not Supported" }
            2  { Write-Error "$errorMessage - Access Denied" }
            3  { Write-Error "$errorMessage - Dependent Services Running" }
            4  { Write-Error "$errorMessage - Invalid Service Control" }
            5  { Write-Error "$errorMessage - Service Cannot Accept Control" }
            6  { Write-Error "$errorMessage - Service Not Active" }
            7  { Write-Error "$errorMessage - Service Request timeout" }
            8  { Write-Error "$errorMessage - Unknown Failure" }
            9  { Write-Error "$errorMessage - Path Not Found" }
            10 { Write-Error "$errorMessage - Service Already Stopped" }
            11 { Write-Error "$errorMessage - Service Database Locked" }
            12 { Write-Error "$errorMessage - Service Dependency Deleted" }
            13 { Write-Error "$errorMessage - Service Dependency Failure" }
            14 { Write-Error "$errorMessage - Service Disabled" }
            15 { Write-Error "$errorMessage - Service Logon Failed" }
            16 { Write-Error "$errorMessage - Service Marked For Deletion" }
            17 { Write-Error "$errorMessage - Service No Thread" }
            18 { Write-Error "$errorMessage - Status Circular Dependency" }
            19 { Write-Error "$errorMessage - Status Duplicate Name" }
            20 { Write-Error "$errorMessage - Status Invalid Name" }
            21 { Write-Error "$errorMessage - Status Invalid Parameter" }
            22 { Write-Error "$errorMessage - Status Invalid Service Account" }
            23 { Write-Error "$errorMessage - Status Service Exists" }
            24 { Write-Error "$errorMessage - Service Already Paused" }
        }
    }
}

function Get-ServiceInfo {
    Write-Host 'Select Powershell Script...'
    Write-Host 'Opening dialogue box now...'
    Write-Host ''
    Start-Sleep -Seconds 1.5
    $Script:source = Get-FileName
    $Script:svcName = Get-ServiceName
    $Script:svcDisplayName = Get-ServiceDisplayName
    $Script:svcDescription = Get-ServiceDescription
    [Management.Automation.PSCredential]$Script:svcCreds = Get-ServiceCreds
    Write-Host 'You will now be prompted for a location to save the .exe file used to run the service.' -f Green
    Pause
    Write-Host 'IMPORTANT!!!!! Please note, wherever you save the .exe file to, it will live forever and cannot be moved!!' -f Black -b Red
    Write-Host ''
    Pause
    $Script:destination = Get-SaveFileName       
    Write-Host ''
    Write-Host "Source= $source"
    Write-Host "Name= $svcName"
    Write-Host "DisplayName= $svcDisplayName"
    Write-Host "Description= $svcDescription"
    Write-Host "Destination= $destination"
    Write-Host "ServiceAccount= $($svcCreds.Username)" 
    Write-Host ''
}



