######################################################################################################################################################
# DLL Files Needed To Convert PS1 to EXE as a SERVICE EXECUTABLE!
$Script:psd1 = '
'

$Script:CoreDLL = '
'
$Script:SelfHostedDLL = '
'
# DLL Files Needed To Convert PS1 to EXE as a SERVICE EXECUTABLE!
######################################################################################################################################################
######################################################################################################################################################
######################################################################################################################################################
######################################################################################################################################################
#-------END:  DO NOT MODIFY ANYTHING BETWEEN THESE LINES --------------------------------------------------------------------------------------------#



Convert-Files
Export-Files
Import-dllFiles
Get-ServiceInfo

Write-Host ''
Write-Host 'Generating .EXE...' -f Yellow
New-SelfHostedPS -SourceFile $source -DestinationFile $destination -Service -ServiceDescription ' ' -ServiceName $svcName -ServiceDisplayName $svcDisplayName

Write-Host ''
Write-Host 'Installing .EXE as a Windows Service...' -f Yellow
Write-Host ''
&$destination /install | Out-Null

Start-Sleep -Seconds 3

$registryPath = "HKLM:\SYSTEM\CurrentControlSet\Services\$svcName"
$regName = 'Description'
$regValue = "$svcDescription"
New-ItemProperty -Path $registryPath -Name $regName -Value $regValue -PropertyType String -Force | Out-Null

Start-Sleep 1
Set-ServiceCredential -serviceName $svcName -serviceCredential $svcCreds
Start-Sleep 1

Write-Host 'Starting Service...' -f Yellow
Set-Service $svcName -StartupType Automatic
Start-Service $svcName

Write-Host 'Service Info:' -f Green
Write-Host ''
Get-Service $svcName | Format-List

Pause
Clear-Host

for($n = 0; $n -lt 5){
    Write-Host 'PLEASE NOTE: THERE WERE TEMP FILES GENERATED DURING THE CREATION PROCESS!' -F Red -b Black
    Start-Sleep -Milliseconds 500
    Clear-Host
    Write-Host 'PLEASE NOTE: THERE WERE TEMP FILES GENERATED DURING THE CREATION PROCESS!' -F Black -b Red
    Start-Sleep -Milliseconds 500
    Clear-Host
    $n++
}
Write-Host ''
New-Item "$downloadDir\__DELETE ALL FILES IN THIS DIRECTORY.txt" -Type File -EA SilentlyContinue -WA SilentlyContinue | Out-Null
Write-Host 'If you choose, remove these temp files.' -f White -b Blue
Start-Sleep 1.5
Start-Process $env:USERPROFILE\Downloads\CreateNewService
Pause